import React from "react";
import { Col, Row, Container } from "../components/Grid";
import Jumbotron from "../components/Jumbotron";

function Bitcoin101() {
  return (
    <Container fluid>
      <Row>
        <Col size="md-12">
          <Jumbotron>
            <h3>Global Integrit Presents</h3>
            <br></br>
          </Jumbotron>
        </Col>
      </Row>
    </Container>
  );
}

export default Bitcoin101;
